fn temp_from_bytes_unchecked(bytes: &[u8]) -> i16 {
    let len = bytes.len();

    // y.f
    let a = (bytes[len - 3] - b'0') as i16 * 10 + (bytes[len - 1] - b'0') as i16;

    match len {
        4 if bytes[0] == b'-' => {
            // -y.f
            -(a)
        }
        4 => {
            // xy.f
            let x = (bytes[0] - b'0') as i16;

            x * 100 + a
        }
        5 => {
            // -xy.f
            let x = (bytes[1] - b'0') as i16;

            -(x * 100 + a)
        }
        3 => {
            // y.f

            a
        }
        _ => unreachable!()
    }
}

