fn temp_from_bytes_checked(bytes: &[u8]) -> Option<i16> {
    let len = bytes.len();

    let mut minus = false;
    let mut res: i16 = 0;

    for (p, i) in bytes.iter().enumerate() {
        match (p, i) {
            (_, b'0'..=b'9') => {res *= 10; res += (i - b'0') as i16}
            (0, b'-') => { minus = true }
            (_, b'.') => { if p != len - 2 { return None } }
            _ => { return None}
        }
    }

    if minus { Some(-(res)) } else { Some(res)}
}

